import React, { useEffect } from "react";
import manitobaMap from "../images/ManitobaFFF.jpg";
import ontarioMap from "../images/OntarioFFF.jpg"
import "./Locations.css";

const Locations = () => {

  useEffect(() => {
    const navbar = document.querySelector('.nav-bar');
    if (navbar) {
      navbar.style.display = 'none';
    }

    return () => {
      if (navbar) {
        navbar.style.display = 'block';
      }
    };
  }, []);

  return (
    <div className="main">
      <section id="locations"></section>
      <h1>Areas We Service</h1>
      <div className="locations">

        <div className="offer_cards_card1">
          <h1>Manitoba</h1>
          <br />
          <p>Use our people, process and technology to deliver your packages</p>
          <a className="service_button_card" href="/Warehousing" target="_blank">
            See more
          </a>
        </div>
        <div className="offer_cards_card2">
          <h1>Ontario</h1>
          <br />
          <p>Use our people, process and technology to deliver your packages</p>
          <a className="service_button_card" href="/Warehousing" target="_blank">
            Area list coming soon!
          </a>
        </div>
      </div>
    </div>
  );
};

export default Locations;
